import React from "react";
import styles from "./StartedPage.module.css";

const StartedPage = () => {
  return (
    <>
      <div className={`${styles.headPage}`}>
        <div className={`${styles.contentHead}`}>
          <div className={`${styles.contentdesign}`}>
            <h3 className={`text-white text-center ${styles.contentText}`}>
              The Most Easiest and Secure Wallet
            </h3>
            <h6 className={`text-center ${styles.contentPara}`}>
              Let's transfer and receive your money with most easy and secure
              way{" "}
            </h6>

            <button>Get Started</button>
          </div>
        </div>
      </div>
    </>
  );
};

export default StartedPage;
